import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import HomePage from './components/HomePage';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route exact path='/' Component={HomePage} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
